asistir personas que est√©n relacionadas con estos procesos. \nLes pido me confirmen por esta v√≠a el nombre y puesto de la(s) persona(s) que nos acompa√±ar√°n. \nContamos con su puntualidad, para poder empezar la reuni√≥n a las 3 en punto. \nDe antemano les agradezco su inter√©s por colaborar con Natura, \n \nSaludos, \nDiana\n \n \n\n___________________________________________________________\nAs informa√ß√µes  contidas  nesta mensagem s√£o CONFIDENCIAIS e protegidas pelo sigilo legal\nA divulga√ß√£o,  distribui√ß√£o  ou reprodu√ß√£o do teor deste documento depende de autoriza√ß√£o do\nemissor.  Caso V. Sa. n√£o seja o destinat√°rio,  preposto, ou a pessoa respons√°vel pela entrega\ndesta mensagem,fica, desde j√°, notificado que qualquer divulga√ß√£o, distribui√ß√£o ou reprodu√ß√£o\n√© estritamente  proibida,  sujeitando-se o  infrator √†s  san√ß√µes  legais.\nCaso esta comunica√ß√£o tenha sido recebida por engano, favor nos avisar imediatamente, respondendo esta mensagem.\n\nLas  informaciones  que contiene este mensaje son CONFIDENCIALES. Si el lector de esta transmisi√≥n no es el\ndestinatario o el agente responsable de la entrega, se notifica que\nusted ha recibido esta comunicaci√≥n por error, y que cualquier divulgaci√≥n, distribuci√≥n, retenci√≥n\no copia de esta comunicaci√≥n est√° estrictamente prohibida. \nEn este caso, por favor, responda este mensaje inmediatamente al remitente.\n\nThe information contained in this message is CONFIDENTIAL.  If the reader of this transmittal is \nnot the intended  recipient or an agent responsible  for delivering it,  you are hereby notified that \nyou have received this communication in error, and that any dissemination,distribution, retention \nor copy of this communication is strictly prohibited.\nIn this case, please immediately reply this message to the sender.\n\n','Natura - Piso 10 - Ej√©rcito Nacional 579',0,900,1439299958,1439227321,4,1,'CONFIRMED',0,0,'','EBF1E2',0,0,NULL,0,'',0);
